@dev Allows the owner to withdraw ETH tokens from stETH.
@param _amounts The amounts of stETH tokens to withdraw.
@param owner The address of the owner who will receive the withdrawn tokens.
@param _permit The permit input for stETH token transfers.
@return requestIds The request IDs of the withdrawal requests.

@dev Computes the withdrawal fee for each element in the given array of amounts, and returns the total fee and the adjusted amounts.
@param _amounts The array of amounts to compute the fees for.
@return totalFee The total amount of fees to be charged.
@return amounts The array of adjusted amounts after subtracting the fees.

@dev Allows the owner to withdraw ETH tokens from wstETH.
@param _amounts The amounts of wstETH tokens to withdraw.
@param owner The address of the owner who will receive the withdrawn tokens.
@param _permit The permit input for wstETH token transfers.
@return requestIds The request IDs of the withdrawal requests.

@dev Allows Lido token holders to claim their staked ETH and withdraw it from the Withdrawal Queue.
@param _requestIds Array of request ids to be withdrawn.
@param _hints Array of hints for faster claim processing.

@dev Exchange stETH for wstETH
@param inAmount the amount to be swapped, the amount of tokens, not shares.
@return outAmount the amount received after the swap

@dev Exchange wstETH for stETH
@param inAmount the amount to be swapped
@return outAmount the amount received after the swap

@dev Wraps Frax tokens into sFRX tokens.
@param inAmount The amount of Frax tokens to wrap.
@return outAmount The amount of sFRX tokens received after wrapping.

@dev Unwraps sFRX tokens into Frax tokens.
@param inAmount The amount of sFRX tokens to unwrap.
@return outAmount The amount of Frax tokens received after unwrapping.

@dev Check if the Rocket protocol deposit pool is full after adding a certain amount.
@param amount The amount to be added.
@return bools The result whether the deposit pool is full or not.

@dev Get the address of a specific smart contract.
@param _contractName The name of the smart contract.
@return contractAddress The address of the smart contract.

@dev Check if the Lido protocol is full after adding a certain amount.
@param amount The amount to be added.
@return bools The result whether the Lido protocol is full or not.
